import React from "react";

const Header = (props) => {
  return (
      <React.Fragment>
          <header>
              <h1>React Meals</h1>
              <button>Cart</button>
          </header>
          <div>
              <img src="../../assets/meals.jpg"/>
          </div>
      </React.Fragment>
  );
};

export default Header;
